import './AntiqueTable.css'
export default function SearchFunction({handleSearchChange}){

    return(
        <div className="searchFunction-container">Search
            <input 
            type="text" 
            placeholder="Type in what you're looking for"
            name="search"
            id="search"
            onChange={handleSearchChange}
            value=''
            aria-label='search for antique input box'
            />
        </div>
    )
}
